import Data from "../Assets/Data/data.json"
import NewsLayout, { HomeCardContent } from "../layouts/NewsLayout";

const updateData = Data.data[0].updateSection;
const csData = Data.data[0].comingSoonSection;

function HomeView() {
    return <div>
        <HomeCardContent title="Social News" contentData={updateData} />
        <HomeCardContent title="Coming Soon" contentData={csData} />
    </div>
}

export default HomeView;
